import s from './s.module.scss';
import avatar from './avatar.png';

export const Header = () => {
    return (
<div className={"banner"}>
    <div className={"container"}>
        <div className={s.header + " row"}>

                    <div className={s.city+ " col"}>
                        <div>Самара</div>
                    </div>

            <div className ={" col"}>
                <div className={s.userInfo}>
                <img
                className={s.avatar}
                src={avatar}
                alt="avatar"
                />
                <div>Василий</div>
                </div>
            </div>
        </div>
    </div>
</div>  
    );
  };
